webpackJsonp([0xb9b59c4095b7],{9073:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Still Cut Off",date:"07 Dec 2007",slug:"/2007-12-07-still-cut-off/",tags:"Y2007"},html:"<p>We finally got a confirmation from T-Systems... our DSL at home will be back up next Monday. I have no idea why a change of DSL provider requires a 6 day downtime.</p>\n<p>I also have no idea why when I try to call the Telekom business customer service hotline, I always end up talking to a household customer service representative who cannot access any data for business customers.</p>\n<p>In the end, our home office will be part of our restaurant VPN, so we'll be able to access all our restaurant data from home. It will be worth it in the end, I'm sure, but the downtime has been very annoying. In the meantime I've rigged up a tin can with a string... that is, a bluetooth connection to a cell phone with a data flatrate... so we can at least read mail and check our bank accounts.</p>"},next:{fields:{title:"No DSL",date:"06 Dec 2007",slug:"/2007-12-06-no-dsl/"}},previous:{fields:{title:"Flying Saucer",date:"14 Dec 2007",slug:"/2007-12-14-flying-saucer/"}}},{node:{fields:{title:"No DSL",date:"06 Dec 2007",slug:"/2007-12-06-no-dsl/",tags:"Y2007"},html:"<p>The PapaScott household is currently without DSL. We have to switch our line from 1&1 to T-Com to connect to our business VPN. The switch was scheduled for the 8th, but the Telekom decided to cut off our access on the 3rd. So the internet will have to get along without us for a few days.</p>"},next:{fields:{title:"Open Glühwein Club",date:"03 Dec 2007",slug:"/2007-12-03-open-gluehwein-club/"}},previous:{fields:{title:"Still Cut Off",date:"07 Dec 2007",slug:"/2007-12-07-still-cut-off/"}}},{node:{fields:{title:"Open Glühwein Club",date:"03 Dec 2007",slug:"/2007-12-03-open-gluehwein-club/",tags:"Y2007"},html:'<p>Nico is hosting a <a href="http://lumma.de/eintrag.php?id=3658">Gl&uuml;hwein get-together</a> at the Rathausmarkt in Hamburg tomorrow evening (Tuesday, 4 Dec) at 6:30 pm. By hosting I mean Nico has set the time and place, not that he\'s buying the first round. But I could be wrong. :-)</p>\n<p>I\'ll try to be there at least for the beginning. How long I stay depends on whether Christopher comes with me or not.</p>\n<p>We\'ll be at the Friesensch&auml;nke stand, which is directly on the left when one faces the Rathaus from the bus stop. I\'ll be standing next to the guy holding a mug of Gl&uuml;hwein.</p>\n<p><a href="http://www.flickr.com/photos/lumma/2077450883/" title="photo sharing"><img src="https://farm3.static.flickr.com/2289/2077450883_190124b7f0_m.jpg" alt="" style="border: 0px;" /></a></p>'},next:{fields:{title:"Second Day with McCafé",date:"02 Dec 2007",slug:"/2007-12-02-second-day-with-mccaf/"}},previous:{fields:{title:"No DSL",date:"06 Dec 2007",slug:"/2007-12-06-no-dsl/"}}}],pathPrefix:"",first:!1,last:!1,index:93,pageCount:1101}}}});
